#
# TABLE STRUCTURE FOR: actor
#

DROP TABLE IF EXISTS `actor`;

CREATE TABLE `actor` (
  `id_actor` smallint(6) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id_actor`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: platform
#

DROP TABLE IF EXISTS `platform`;

CREATE TABLE `platform` (
  `id_platform` smallint(6) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id_platform`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: show
#

DROP TABLE IF EXISTS `show`;

CREATE TABLE `show` (
  `id_show` smallint(6) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `release_year` smallint(6) DEFAULT NULL,
  `duration` smallint(6) DEFAULT NULL,
  `description` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `date_added` datetime DEFAULT NULL,
  PRIMARY KEY (`id_show`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: show_actor
#

DROP TABLE IF EXISTS `show_actor`;

CREATE TABLE `show_actor` (
  `id_show` smallint(6) NOT NULL,
  `id_actor` smallint(6) NOT NULL,
  PRIMARY KEY (`id_show`,`id_actor`),
  KEY `id_actor` (`id_actor`),
  CONSTRAINT `show_actor_ibfk_1` FOREIGN KEY (`id_show`) REFERENCES `show` (`id_show`),
  CONSTRAINT `show_actor_ibfk_2` FOREIGN KEY (`id_actor`) REFERENCES `actor` (`id_actor`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: show_platform
#

DROP TABLE IF EXISTS `show_platform`;

CREATE TABLE `show_platform` (
  `id_show` smallint(6) NOT NULL,
  `id_platform` smallint(6) NOT NULL,
  PRIMARY KEY (`id_show`,`id_platform`),
  KEY `id_platform` (`id_platform`),
  CONSTRAINT `show_platform_ibfk_1` FOREIGN KEY (`id_show`) REFERENCES `show` (`id_show`),
  CONSTRAINT `show_platform_ibfk_2` FOREIGN KEY (`id_platform`) REFERENCES `platform` (`id_platform`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: show_type
#

DROP TABLE IF EXISTS `show_type`;

CREATE TABLE `show_type` (
  `id_show` smallint(6) NOT NULL,
  `id_type` smallint(6) NOT NULL,
  PRIMARY KEY (`id_show`,`id_type`),
  KEY `id_type` (`id_type`),
  CONSTRAINT `show_type_ibfk_1` FOREIGN KEY (`id_show`) REFERENCES `show` (`id_show`),
  CONSTRAINT `show_type_ibfk_2` FOREIGN KEY (`id_type`) REFERENCES `type` (`id_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: type
#

DROP TABLE IF EXISTS `type`;

CREATE TABLE `type` (
  `id_type` smallint(6) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id_type`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



